import React, {createRef} from 'react';
import {withTranslation, WithTranslation} from 'react-i18next';
import {RouteComponentProps, withRouter} from 'react-router-dom';
import Header from 'src/components/header/Header';
import Button from 'react-bootstrap/Button';
import {Dispatch} from 'redux';
import {connect} from 'react-redux';
import {ScrollTrigger, ScrollToPlugin, gsap} from 'gsap/all';
import videojs, {VideoJsPlayer} from 'video.js';

import './Fiole.css';
import fiole from './Fiole_BIG.png';
import fiole2x from './Fiole_BIG@2x.png';
import arrowDown from './Arrow_down.png';
import arrowDown2x from './Arrow_down@2x.png';
import video from './FIOLE_anim_1.mp4';
import BarNavigation from 'src/components/barnavigation/BarNavigation';
import {ReduxAppState} from '../../store';
import {hasCompletedXp} from '../../store/root/actions';
import {RootActionTypes} from '../../store/root/types';

gsap.registerPlugin(ScrollTrigger, ScrollToPlugin);

const options = {
  html5: true,
  fluid: true,
  loop: false,
  controls: false,
  fill: true,
  preload: 'auto',
};

type DispatchProps = {
  hasCompletedXp: () => RootActionTypes;
};

type Prop = DispatchProps & WithTranslation & RouteComponentProps;

class Fiole extends React.Component<Prop> {
  private ref = createRef<HTMLDivElement>();
  private videoJs: VideoJsPlayer | null = null;

  componentDidMount(): void {
    if (this.ref.current) {
      const sections = this.ref.current.querySelectorAll('section');
      sections.forEach((section) => {
        ScrollTrigger.create({
          trigger: section,
          onEnter: () => this._goToSection(section),
        });
        ScrollTrigger.create({
          trigger: section,
          start: 'bottom bottom',
          onEnterBack: () => this._goToSection(section),
        });
      });
    }
    this._setupVideoJs();
  }

  componentDidUpdate(): void {
    this._dispose();
    this._setupVideoJs();
  }

  componentWillUnmount(): void {
    this._dispose();
  }

  _goToSection = (section: HTMLElement) => {
    console.log('_goToSection', section.className);
    gsap.to(window, {
      scrollTo: {y: section, autoKill: false},
      duration: 1,
    });
    if (section.className === 'videoContent' && this.videoJs !== null) {
      this.videoJs.play();
    }
  };

  _setupVideoJs = (): void => {
    console.log('_setupVideoJs', this.videoJs);
    this.videoJs = videojs(document.querySelector('.videoContent video'), options);
    this.videoJs.one('ended', () => this._onVideoEnd());
    this.videoJs.loop(false);
    this.videoJs.playsinline(true);
  };

  _dispose = (): void => {
    console.log('_dispose', this.videoJs);
    if (this.videoJs !== null) {
      this.videoJs.dispose();
      this.videoJs = null;
    }
  };

  _onVideoEnd = (): void => {
    console.log('_onVideoEnd');
    gsap.to('.video-js', {
      autoAlpha: 0,
      display: 'none',
      duration: 1,
    });
    gsap.to('.fiole-content', {
      autoAlpha: 1,
      display: 'block',
      duration: 1,
    });
    this.props.hasCompletedXp();
  };

  render() {
    const {t} = this.props;
    return (
      <div className="fiole">
        <Header />
        <div className="section1">
          <p>{t('main.section1.text1')}</p>
          <p>{t('main.section1.text2')}</p>
          <p>
            {t('main.section1.text3')}
            <b>{t('main.section1.text4')}</b>
          </p>
          <p></p>
        </div>
        <div ref={this.ref} className="mainContent">
          <section className="flacon">
            <img src={fiole} srcSet={fiole2x} />
            <Button variant="outline-light">{t('fiole.telechargerdossierpresse')}</Button>
            <p>{t('fiole.defilezfairevibrer')}</p>
            <img className="arrow-down" src={arrowDown} srcSet={arrowDown2x} />
          </section>
          <section className="videoContent">
            <video
              className="video-js vjs-16-9 vjs-control-bar"
              muted
              playsInline
              webkit-playsinline="true"
              controls={false}>
              <source src={video} />
            </video>
            <div className="fiole-content">
              <BarNavigation />
            </div>
          </section>
        </div>
      </div>
    );
  }
}

const mapDispatchToProps = (dispatch: Dispatch): DispatchProps => {
  return {
    hasCompletedXp: () => dispatch(hasCompletedXp()),
  };
};

export default connect<unknown, DispatchProps, unknown, ReduxAppState>(
  undefined,
  mapDispatchToProps,
)(withTranslation()(withRouter(Fiole)));
